for (let i = 0; i < sections.length; i++) {
    let section = document.createElement('div');
    section.id = sections[i];
    section.classList.add('section');
    document.getElementById('sections').appendChild(section);
}

document.querySelectorAll('.navitem').forEach(link => {
    let navhover = document.getElementById('navhover');
    link.addEventListener('mouseenter', () => {
        let rect = link.getBoundingClientRect();
        let parentRect = link.parentElement.getBoundingClientRect();
        navhover.style.width = rect.width + 'px';
        navhover.style.left = (rect.left - parentRect.left + link.parentElement.scrollLeft) + 'px';
        navhover.style.opacity = '1';
    });
    link.addEventListener('mouseleave', () => {
        navhover.style.opacity = '0';
    });
});

document.getElementById('hamburger').addEventListener('click', () => {
    document.getElementById('hamburger').classList.toggle('active');
    document.getElementById('menuItems').classList.toggle('show');
});

